import React from 'react';
import '../styles/global.css';
import consumer from '../assets/content-images/consumer.png';

const MyVouchers = () => {
    const styles = {
        container: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
        },
        header: {
            textAlign: 'center',
            fontFamily: 'Rethink Sans',
            fontSize: '40px',
            fontWeight: '800',
            marginBottom: '50px',
        },
        greenBg: {
            width: '350px',
            height: '400px',
            backgroundColor: '#26AA99',
            marginTop: '100px',
            marginLeft: '-900px',
        },
        borderbox: {
            border: '4px solid #000',
            width: '350px',
            height: '350px',
            marginLeft: '-820px',
            position: 'absolute',
        },
        imageContainer: {
            position: 'relative',
            zIndex: 3,
          },
          image: {
            width: '500px',
            height: '300px',
            objectFit: 'cover',
            position: 'absolute',
            top: '250px',
            left: '50%',
            transform: 'translateX(-50%)',
          },
    }




  return (
    <div style={styles.container}>
        <h2 style={styles.header}>YOUR VOUCHERS</h2>
        <div style={styles.greenBg}></div>
        <div style={styles.borderbox}></div>
        <div style={styles.imageContainer}><img src={consumer} alt="consumer" style={styles.image} /></div>
    </div>
  );
};

export default MyVouchers;
